import React from 'react';



export default class Selector extends React.Component {



    render(){
        return(


      <select id="mySelect" onchange="{this.props.onChangeLey()}">
        <option value="0">Audi</option>
        <option value="1">BMW</option>

      </select>


        );
    }
}
